import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { apiRequest } from "../api/apiRequest";
import "../Home.css"; // Import the CSS file

const Home = () => {
    const navigate = useNavigate();

    useEffect(() => {
        console.log("Testing API Endpoint");

        const fetchAllUsers = async () => {
            try {
                const response = await apiRequest("users", "GET", "");
                if (response.success) {
                    console.log("Fetched users:", response.data);
                } else {
                    console.error("Error fetching users:", response.message);
                }
            } catch (error) {
                console.error("Error:", error);
            }
        };

        const fetchUserById = async (userId: string) => {
            try {
                const response = await apiRequest("users", "GET", userId);
                if (response.success) {
                    console.log(
                        `Fetched user with ID ${userId}:`,
                        response.data
                    );
                } else {
                    console.error(
                        `Error fetching user with ID ${userId}:`,
                        response.message
                    );
                }
            } catch (error) {
                console.error("Error:", error);
            }
        };

        const registerUser = async () => {
            try {
                const response = await apiRequest("users", "POST", "register", {
                    username: "newuser5",
                    email: "newuser5@example.com",
                    password: "password123",
                    isAdmin: false,
                    isSuperAdmin: false,
                });
                if (response.success) {
                    console.log("User registered successfully:", response.data);
                } else {
                    console.error("Error registering user:", response.message);
                }
            } catch (error) {
                console.error("Error:", error);
            }
        };

        console.log("Testing API Endpoints:");
        registerUser();
        fetchAllUsers();
        fetchUserById("60d21b4667d0d8992e610c85");
    }, []);

    return (
        <div className="home-container">
            <div className="flex-container">
                {/* Logo section */}
                <div className="logo-section">
                    <div className="logo-box">
                        (Logo) Eleos
                    </div>
                </div>

                {/* Log In and Sign Up Buttons */}
                <div className="button-section">
                    <button
                        onClick={() => navigate("/Login")}
                        className="button button-login"
                    >
                        Log In
                    </button>
                    <button
                        onClick={() => navigate("/signup")}
                        className="button button-signup"
                    >
                        Sign Up
                    </button>
                </div>
            </div>
        </div>
    );

};

export default Home;
